// Importación de estilos CSS
import "../../../css/Client/home.css";
import { useNavigate, useParams, Link } from 'react-router-dom';

// Importación del componente Footer
import { Footer } from "../footer/footer";
import axios from "axios";
import React, { useState, useEffect } from 'react';


// Componente Index
    function Index() {
        const navigate = useNavigate();
        const { precio: precioParam, tipo: tipoParam } = useParams();
      
        const [inmuebles, setInmuebles] = useState([]);
        const [images, setImages] = useState([]);
        const [precioFiltro, setPrecioFiltro] = useState(precioParam || '');
        const [tipoInmuebleFiltro, setTipoInmuebleFiltro] = useState(tipoParam || '');
      
        useEffect(() => {
          const fetchData = async () => {
            try {
              const response = await axios.get(`http://localhost:3001/verInmuebles?precio=${precioFiltro}&tipo=${tipoInmuebleFiltro}`);
              setInmuebles(response.data.rows);
              setImages(response.data.images);
              console.log(response.data);
            } catch (error) {
              console.error('Error fetching data:', error);
            }
          };
      
          fetchData();
        }, [precioFiltro, tipoInmuebleFiltro]);
      
        function verInmueble(idInmueble) {
          console.log(idInmueble);
          navigate(`state/${idInmueble}`);
        }
      
        const opciones = { style: 'decimal', maximumFractionDigits: 2 };
      
        const handlePrecioChange = (e) => setPrecioFiltro(e.target.value);
        const handleTipoInmuebleChange = (e) => setTipoInmuebleFiltro(e.target.value);
      
        const handleBuscarClick = () => {
          // Aquí puedes navegar a la página de Estate y pasar los filtros como parámetros de la URL
         
        };
      
        return (
          <div>
            {/* Contenedor principal de la página de inicio */}
            <div className="container-index">
              {/* Título principal */}
              <div className="main-title-box">
                <p className="txt-white">Encuentra el <b>inmueble </b> perfecto con nosotros</p>
              </div>
              {/* Filtros de búsqueda */}
              <div className="filter-box">
                <div className="filter-index">
                  {/* Selección de precio */}
                  <select className="select" value={precioFiltro} onChange={handlePrecioChange}>
                    <option value="">Precio</option>
                    <option value="50">menos de 50 millones</option>
                    <option value="50-100">50 - 100 millones</option>
                    <option value="100-200">100 - 200 millones</option>
                    <option value="200-200">200 - 300 millones</option>
                    <option value="300">más de 300 millones</option>
                  </select>
                  {/* Selección de tipo de inmueble */}
                  <select className="select" value={tipoInmuebleFiltro} onChange={handleTipoInmuebleChange}>
                    <option value="">Tipo de Inmueble</option>
                    <option value="Casa">Casa</option>
                    <option value="Casa lote">Casa lote</option>
                    <option value="Lote">Lote</option>
                    <option value="Apartamento">Apartamento</option>
                  </select>
                  {/* Botón de búsqueda */}
                  <button className="search-btn" onClick={handleBuscarClick}>
                    <span className="material-symbols-outlined">search</span>Buscar
                  </button>
                </div>
              </div>
              {/* Indicador de desplazamiento */}
              <div className="arrow-box">
                <span className="material-symbols-outlined">arrow_downward</span>
              </div>
            </div>
      
            {/* Contenido de los inmuebles */}
            <div className="container-estates">
              <div className="text-estate">
                <div className="title-estate">
                  <p>Inmuebles</p>
                </div>
                <div className="info-estate">
                  <p>Desde casas hasta lotes, con el filtro de búsqueda encuentra lo que necesitas</p>
                </div>
                <div className="houses-catalogue">
                  {inmuebles.map((casa, index) => (
                    <div key={casa.idInmueble} className="house-catalogue">
                      {images[index] && images[index].imagen && (
                        <img src={`http://localhost:3001/${images[index].imagen}`} alt={`Inmueble ${casa.idInmueble}`} />
                      )}
                      <div className="house-description-catalogue">
                        <h3 className="house-h2-description txt-white">{casa.tipoInmueble} {casa.barrio}</h3>
                        <p className="area-description txt-white">area: {casa.areaLote} m²</p>
                        <h3 className="house-h2-description txt-white">COP: ${Number(casa.precio).toLocaleString('es-ES', opciones)}</h3>
                      </div>
                      <button className="show-state-catalogue txt-black" onClick={() => verInmueble(casa.idInmueble)}>Ver</button>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          </div>
        );
      }

// omponente AboutBox
function AboutBox({ title, info, svg }) {
    return (
        // Contenedor de una caja de información
        <div className="info-box">
            <div>
                {/* Título e información */}
                <h3>{title}</h3>
                <p>{info}</p>
            </div>
            <div className="line-info-box"></div>
            {/* Icono */}
            <div className="icon-box">
                <img src={svg} alt="Icono" className="img-about-box"></img>
            </div>
        </div>
    );
}

// Componente About
function About() {
    return (
        // Sección "Acerca de Nosotros"
        <section className="about">
            <div className="about-content">
                <div className="text-estate">
                    {/* Título e información sobre nosotros */}
                    <div className="title-estate">
                        <p>Nosotros</p>
                    </div>
                    <div className="info-estate">
                        <p>Nuestra historia y por qué elegir nuestros servicios</p>
                    </div>
                </div>
                {/* Cajas de información */}
                <div className="info-boxes">
